def checkInclusion(s1, s2):
    def isMatch(mp1, mp2):
        for k,v in mp1.items():
            if v != mp2.get(k,0):
                return False
        return True

    map1 = {}
    map2 = {}
    N, M = len(s1), len(s2)
    if N>M:return False

    start,end = 0, N
    for i in range(N):
        map1[s1[i]] = map1.get(s1[i], 0)+1
        map2[s2[i]] = map2.get(s2[i], 0)+1

    while end < M:
        if isMatch(map1, map2):
            return True
        map2[s2[end]] = map2.get(s2[end],0) + 1
        map2[s2[start]] -= 1

        start += 1
        end += 1

    return isMatch(map1, map2)


